        public static string AddAction(string Name, string IDCardNo, string OprCode)
        {
            string url = Global.Config.AddActionUrl;
            Dictionary<string, object> dic = new Dictionary<string, object>
                {
                    {"ip", Global.IP},
                    {"mac", Global.MAC},
                    { "strPersonName", Name },
                    { "id_card_no", IDCardNo },
                    { "opr_code", OprCode },
                    { "zzjid", Global.Config.TerminalName }
                };
            string response = Requests.Get(url, dic, 200);
            Log.WriteUrl(url,response);
            return response;
        }

